import React, { useEffect, useState } from 'react';

const Services = () => {
    const [services, setServices] = useState([])
    useEffect(() => {
      fetch('services.json')
      .then(res => res.json())
      .then(data=> setServices(data))
      .catch(err => console.log(err))
    }, [])

    return (
        <div>
            Services
        </div>
    );
};

export default Services;
